// src/pages/RankingsPage.jsx
import React from "react";
import RankingsTabs from "../components/rankings/RankingsTabs";

const RankingsPage = () => {
  return (
    <div className="icc-ranking-section">
      <div className="ranking-header"><h3>ICC Rankings</h3></div>
      {/* Full tables */}
      <RankingsTabs compactTop={0} />
    </div>
  );
};
export default RankingsPage;
